import React , {Component} from 'react';
import Component1 from './nested component';
class App extends Component{

  //arrow function

  myfun = (x,y)=>
  {
    console.log(x/y);
  }
  render(){
    return(
      <div className="App">
         <Component1/>
         {this.myfun(10,5)}
      </div>
    );
  }
}

export default App;
